struct Foo : public ceto::shared_object, public std::enable_shared_from_this<Foo> {

    decltype(std::vector {{1, 2, 3}}) a = std::vector {{1, 2, 3}};

        inline auto foo() const -> void {
            const auto a = (this -> a);
            for(const auto& x : a) {
                std::cout << x;
                std::cout << "\n";
            }
            auto && b { (this -> a) } ;
            for(const auto& x : b) {
                std::cout << x;
            }
        }

};

    auto main() -> int {
        const auto f = std::make_shared<const Foo>();
        (*ceto::mad(f)).foo();
    }

